import { getUrl } from "../apis/api";



const RedirectPage =  () => {

    const pathtext= window.location.pathname ;
    if(pathtext.length!==0){
        pathtext = pathtext.substring(1);
    }

    getUrl();

    return (
        <h5> Redirecting to {pathtext} </h5>
    );

}

export default RedirectPage;
